import React from 'react';
import Card from './Card';
import { NavLink } from 'react-router-dom';
import './ctCard.css';

function CtCard() {
  return (
    <div>
      <Card width='300px' height='500px'>
        <div>
          <NavLink
            exact
            activeClassName='menu_active'
            className='nav-link active'
            aria-current='page'
            to='/'
          >
            <img
              className='ct__img'
              src={require(`../../../Assets/Images/Project Image/javascript.png`)}
              alt='avatar image'
            />

            <h1>javascript</h1>
          </NavLink>
        </div>
      </Card>
    </div>
  );
}

export default CtCard;
